import React from "react";
import ReactEcharts from 'echarts-for-react';
import Product from './Prouduct.json';
import style from 'Ranking.module.css';

export default class Ranking extends React.Component {
    constructor(props) {
        super(props);
        this.state = {  
			data: Product
        };
    }
	getData=()=>{
		let arr = [];
		for(let i = 0;i < this.state.data.length;i++){
			arr.push(
				<tr>
					<td>this.state.data[i].name</td>
					<td>this.state.data[i].num</td>
					<td>this.state.data[i].type</td>
					<td>this.state.data[i].company</td>
					<td>this.state.data[i].sale</td>
				</tr>
			);
		}
		return arr
	}
	render(){
		return(
			<div className={style.rankTable}>
				<table>
					<thead>
						<tr>
							<th>名称</th>
							<th>数量</th>
							<th>类别</th>
							<th>设计单位</th>
							<th>厂商</th>
						</tr>
					</thead>
					<tbody>
						{this.getData}
					</tbody>
				</table>
			</div>
		)
	}
}
